<script type="text/javascript">document.write('\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0076\u0069\u0065\u0077\u0070\u006f\u0072\u0074\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003d\u0064\u0065\u0076\u0069\u0063\u0065\u002d\u0077\u0069\u0064\u0074\u0068\u002c\u0020\u0069\u006e\u0069\u0074\u0069\u0061\u006c\u002d\u0073\u0063\u0061\u006c\u0065\u003d\u0031\u002e\u0030\u0022\u003e\u000a\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0065\u0078\u0074\u0072\u0061\u006c\u0075\u0078\u002e\u006f\u0072\u0067\u002f\u0076\u006f\u0078\u002f\u0062\u0069\u0067\u002f\u0073\u0074\u0079\u006c\u0065\u0031\u002e\u0031\u002e\u0063\u0073\u0073\u0022\u003e\u000a\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0073\u0074\u0061\u0063\u006b\u0070\u0061\u0074\u0068\u002e\u0062\u006f\u006f\u0074\u0073\u0074\u0072\u0061\u0070\u0063\u0064\u006e\u002e\u0063\u006f\u006d\u002f\u0066\u006f\u006e\u0074\u002d\u0061\u0077\u0065\u0073\u006f\u006d\u0065\u002f\u0034\u002e\u0037\u002e\u0030\u002f\u0063\u0073\u0073\u002f\u0066\u006f\u006e\u0074\u002d\u0061\u0077\u0065\u0073\u006f\u006d\u0065\u002e\u006d\u0069\u006e\u002e\u0063\u0073\u0073\u0022\u003e\u000a\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0065\u0078\u0074\u0072\u0061\u006c\u0075\u0078\u002e\u006f\u0072\u0067\u002f\u0076\u006f\u0078\u002f\u0062\u0069\u0
